	@Test
	public void ensure_that_manufactured_SOAP_Request_has_images_that_are_base64encoded_only_once()
	{
		AccountApplicationRequestTypeConverter sut = new AccountApplicationRequestTypeConverter();

		CreditCardApplicationData appData = new CreditCardApplicationData(cardDataStringJason);
		AccountApplicationRequestType aart = sut.createAccountApplicationRequestFromCreditCardApplicationData(appData,null,false);
		String aartString = "";
		try
		{
			aartString = new WICIObjectsHelper().accountApplicationSerialize(aart);
		}
		catch (Exception e)
		{
			e.printStackTrace();
		}

		System.out.println("XML String=" + aartString);

		// Assert.assertEquals("/9j/4AAQSkZJRgA", aartString);
		Assert.assertTrue(aartString.contains("<applicantSignature>/9j/4AAQSkZJRgABAgAAAQABAAD/2wBDAAoHBwgHBgoI"));
		//Assert.assertTrue(aartString.contains("<insuranceSignature>/9j/4AAQSkZJRgABAgAAAQABAAD/2wBDAAoHBwgHBgoI"));
	}

	@Test
	public void ensure_that_main_signature_image_is_base64encoded_but_once_and_can_be_written_to_disk()
	{
		CreditCardApplicationData appData = new CreditCardApplicationData(cardDataStringJason);
		BaseModel signatureModel = appData.getModel("signatureModel");
		byte[] base64ImageAsByteArray = null;
		try
		{
			base64ImageAsByteArray = signatureModel.getBase64EncodedJPGByteArray("userSingnature");
		}
		catch (Exception e)
		{
			e.printStackTrace();
		}
		Assert.assertEquals(true, new ImageUtils().isBase64EncodedOnlyOnce(base64ImageAsByteArray));

		String base64EncodedJPGImageAsString = new String(base64ImageAsByteArray);

		System.out.println("New jasonImageString=" + base64EncodedJPGImageAsString);

		byte[] decodedJPG = Base64.decodeBase64(base64ImageAsByteArray);

		FileOutputStream fos;
		try
		{
			fos = new FileOutputStream("test/jasonImageStringNew.jpg");
			fos.write(decodedJPG);
			fos.close();
		}
		catch (Exception e)
		{
			e.printStackTrace();
		}

	}

	@Test
	public void ensure_that_main_signature_image_is_base64_encoded_only_once_when_assigned()
	{
		CreditCardApplicationData appData = new CreditCardApplicationData(cardDataString);

		BaseModel signatureModel = appData.getModel("signatureModel");
		String base64ImageStringified = signatureModel.get("userSingnature");
		byte[] base64ImageAsByteArray = null;

		try
		{
			base64ImageAsByteArray = new ImageUtils().convertPNGDataURLToJPGByteArray(base64ImageStringified);
		}
		catch (Exception e)
		{
			e.printStackTrace();
		}

		Assert.assertEquals(true, new ImageUtils().isBase64EncodedOnlyOnce(base64ImageAsByteArray));

		try
		{
			base64ImageAsByteArray = signatureModel.getBase64EncodedJPGByteArray("userSingnature");
		}
		catch (Exception e)
		{
			e.printStackTrace();
		}

		Assert.assertEquals(true, new ImageUtils().isBase64EncodedOnlyOnce(base64ImageAsByteArray));
	}

